var theReport = parameters.reportID;
var token = req.apiKey.getApiKey();
var settings = {sysfilter: "equal(report_id:1)"};

var response=[];

var parts = SysUtility.getResource("reports",settings);
for (var i in parts) {
    log.debug("DEBUG...START");
    log.debug(parts[i].report_description);
    for (var j in parts[i].model_report_items_List) {
        log.debug(parts[i].model_report_items_List[j].collection_id_collections.name);
        log.debug(parts[i].model_report_items_List[j].collection_id_collections.level);
        var errCaught = false ;
        try {
            var resource = SysUtility.restGet('http://localhost:8080/rest/default/model/v1/' + parts[i].model_report_items_List[j].collection_id_collections.name,
                {},
                {
                    headers: {
                        "Authorization": "CALiveAPICreator " + token + ":1",
                        "Cache-Control": "no-cache"
                    }
                }
            );
        }
        catch(err) {
            log.debug("DEBUG...ERROR>>>>>>>>>>>>>>>>......");
            errCaught = true;
        }
        if (!errCaught) { response.push(JSON.parse(resource));}
    }
    log.debug("DEBUG...END");
}


return response;

